import React, { useState } from 'react';
import TechnicalDashboard from './components/TechnicalDashboard';
import TechnicalNavigation from './components/TechnicalNavigation';
import ReportsSection from './components/ReportsSection';
import LiveChat from './components/LiveChat';
import './App.css';

function App() {
  const [currentSection, setCurrentSection] = useState('dashboard');
  const [isConnected, setIsConnected] = useState(false);

  const renderSection = () => {
    switch (currentSection) {
      case 'dashboard':
        return <TechnicalDashboard />;
      case 'equipment':
        return <div style={{ padding: '2rem', marginTop: '70px' }}>Sección de Equipamiento - En desarrollo</div>;
      case 'maintenance':
        return <div style={{ padding: '2rem', marginTop: '70px' }}>Sección de Mantenimiento - En desarrollo</div>;
      case 'reports':
        return <ReportsSection />;
      case 'analytics':
        return <div style={{ padding: '2rem', marginTop: '70px' }}>Sección de Analíticas - En desarrollo</div>;
      case 'settings':
        return <div style={{ padding: '2rem', marginTop: '70px' }}>Sección de Configuración - En desarrollo</div>;
      default:
        return <TechnicalDashboard />;
    }
  };

  return (
    <div className="App">
      <TechnicalNavigation 
        currentSection={currentSection}
        isConnected={isConnected}
        onSectionChange={setCurrentSection}
      />
      {renderSection()}
      <LiveChat />
    </div>
  );
}

export default App;
